import logo from './logo.svg';
import bg from './bg.svg'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>ТУН УДАХГҮЙ</h1>
        <p>
        Та манай апп ашиглан өөрт хамгийн ойр <br/> машиныг захиалан унаж, дуртай <br/> газраа орхиод явах боломжтой.
        </p>
      </header>
    </div>
  );
}

export default App;
